Self-care is the best care 🌸

Have you had a chance to watch the new season of Harlem??? 😀I'm so excited to binge  @HarlemonPrime Season 2 on @PrimeVideo this weekend. To celebrate the new season, I curated this amazing wellness box featuring some black-owned self-care essentials. 

@twenteaco teas + infuser
@talandbert Geode candle
@berootedco journal
