This is a reminder, that you deserve a relaxing, couch-chilling, binge-watching, candles lit, sage waving, tea sipping and journaling weekend 💕💕

@TheAyarsAgency #HarlemOnPrime #PrimeVideoCreator 

#unboxing #unboxingvideo #wellnessblogger #wellnessbrand #selfcaresaturday

God, I will be the voice to voiceless. I will be a listening ear for those who never felt heard. I will show love to those who felt unlovable.

@hellonecole called me and asked that I post this clip. I'm so proud of her strength because she doesn't look like what she's been through. 

To all of you who've experienced this violation, I'm sorry. My heart breaks for you. I come against the lie of the enemy who tried to convince you you were damaged goods. I cancel the word curse that no one would love you due to your past trauma. You are a gift. A prize. You are still beautifully and wonderfully made. They could never rob you of your purpose. I encourage you to shake off the shame and walk in your purpose.
